webpackJsonp([39253572815877],{355:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Altitude Adventure Holidays",author:"Riddho Datta"}},markdownRemark:{id:"/Users/nirmalya/Development/personal/github/altitude-adventure-holidays/src/pages/testimonial-1/index.md absPath of file >>> MarkdownRemark",html:"<p>We were on a trek to the remote Sundardunga Valley, organized by Riddha and his team at Altitude, in last October. We had a cracking time ourselves, thanks to Riddha and his team. These guys are the pioneers of how to have fun on a trip to the wild and they plan everything accordingly. Their attention to detail and supreme knowledge of the area really stands out. And I must say there can't be any more capable leader than Riddha, when venturing into the mountains. Thanks to him for making our time a life-changing experience.</p>\n<p>Strongly recommend Altitude for anyone planning a Trek or Climb in Indian Himalaya. Looking forward myself to the next trip with you guys!!</p>",frontmatter:{title:"S. Ganguly",date:"July 12, 2017"}}},pathContext:{}}}});
